     name={entry.name}
     meaning={entry.meaning}
   />
 );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
      {emojipedia.map(createEntry)}
      </dl>
    </div>
  );
}

export default App;
